import { Component } from 'react'
import { AMap} from './config'

class Map extends Component {
    componentDidMount(){

        const map= new AMap.Map('map',{
            center:[114,35],
            zoom:12
        })

        const marker= new AMap.Marker({
            position:[114,35],
            title:'村里'
        })

        map.add(marker)
    }



    render(){
        return null
    }
}

export default Map
